import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Menu, MenuItem } from '@blueprintjs/core';

export default class MainMenu extends Component {
   render() {
      return (
         <Menu>
            <MenuItem icon='application' text='About this app...' />
            <Link to='/Settings'>
               <MenuItem icon='cog' text='System Preferences' />
            </Link>
            <MenuItem
               icon='applications'
               text='Apps'
               popoverProps={{ openOnTargetFocus: false }}
               shouldDismissPopover={true}
            >
               <Link to='/Dashboards'>
                  <MenuItem icon='dashboard' text='Dashboard' />
               </Link>
               <Link to='/Projects'>
                  <MenuItem icon='projects' text='Project' />
               </Link>
               <Link to='/Reports'>
                  <MenuItem icon='manually-entered-data' text='Reports' />
               </Link>
               <Link to='/AdminPanel'>
                  <MenuItem icon='control' text='Admin' />
               </Link>
            </MenuItem>
         </Menu>
      );
   }
}
